in_source: |-
  (begin
      (defun factorial (begin x)
          (begin
              (cond
                  (<= x 1) (begin 1)
                  (> x 1) (begin (* x (factorial (- x 1))))
              )
          )
      )
      (print (factorial 5))
  )
